import React from 'react';
import reactDom from 'react-dom';
import ReactDom from 'react-dom';
import Grouping from './Grouping';

let x;

function Tile(props){
    if(props.number == 1){
        x = 'red';
    }
    return <div className='tile' style={{backgroundColor:x}}>
        <div className='atomicNum'>
            <p>{props.number}</p>
        </div>
        <div className='atomicSymbol'>
            <h1> {props.symbol}</h1>
        </div>
        <div className='atomicName'>
            <h2>{props.name}</h2>
        </div>
    </div>
}


export default Tile;
